tables.table_schema:
CREATE TABLE RealEstateAssets (
    id INT PRIMARY KEY,
    asset_name VARCHAR(255),
    asset_address VARCHAR(255),
    value DECIMAL(10, 2)
);

CREATE TABLE OwnershipTokens (
    token_id INT PRIMARY KEY,
    asset_id INT,
    owner_id INT,
    percentage_owned DECIMAL(5, 2)
);

CREATE TABLE FractionalOwnership (
    owner_id INT PRIMARY KEY,
    asset_id INT,
    percentage_owned DECIMAL(5, 2),
    FOREIGN KEY (asset_id) REFERENCES RealEstateAssets(asset_id)
);

CREATE TABLE owners (
    owner_id INT PRIMARY KEY,
    owner_name VARCHAR(255),
    email VARCHAR(100),
    phone_number VARCHAR(15)
);

CREATE TABLE Properties (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(255) NOT NULL,
    location VARCHAR(255) NOT NULL,
    area_sqft INT
);

CREATE TABLE Owners (
    owner_id INT PRIMARY KEY,
    owner_name VARCHAR(255) NOT NULL,
    email VARCHAR(255) UNIQUE
);
